import React from "react";

import erasmus from "./logo/img_avatar2.png"
import hems from "./logo/hems.jpg"

class FrgtPass extends React.Component {
    render() {
        return (
            <div>

                <div class="w3-top">
                    <div class="w3-bar w3-theme1" id="myNavbar">
                    <a class="w3-bar-item w3-button w3-hover-white w3-hide-medium w3-hide-large w3-right" href="javascript:void(0);" onclick="toggleFunction()" title="Toggle Navigation Menu">
                        <i class="fa fa-bars"></i>
                    </a>
                    <a href="/impress" class="w3-bar-item w3-button w3-text-white w3-hide-small"><i class="fa fa-book"></i> Legal notice</a>
                    </div>
                
                    <div id="navDemo" class="w3-bar-block w3-theme1 w3-hide w3-hide-large w3-hide-medium">
                    <a href="/impress" class="w3-bar-item w3-button" onclick="toggleFunction()">Legal notice</a>
                    </div>
                </div>

                <div class="imgcontainer">
                    <img src={erasmus} alt="Avatar" class="avatar"/>
                    <img src={hems} alt="Avatar2" class="avatar"/>
                </div>

            </div>
        );
    }
}

export default FrgtPass;
